import React from 'react';
import Card from './Card';


const CardList = ({iarba}) =>{
    return(
        <div>
            {   iarba.map((user, i) =>{
                    return(
                        <Card
                        key={iarba[i].id}
                        id={iarba[i].id}
                        name={iarba[i].name}
                        speed={iarba[i].speed}
                        />)
                })
                
            }
        </div>
    )
}

export default CardList;
